    const [value, setValue] = useState('');
    return (
        <select {...props} value={value} onChange={e =>setValue(e.target.value)}>
            {cats.map(cat =>
                <option key={cat.id} value={cat.name} >
                    {cat.name}
                </option>
            )}
        </select>

    )
}

